import React from "react";

function Header() {
  return (
    <div className="App-header">
      <img
        className="logo"
        src={"https://i.ytimg.com/vi/Xfv0j9_zuN0/maxresdefault.jpg"}
        alt="Netflix Logo"
      />
    </div>
  );
}

export default Header;
